def getNeededClosingBrackets(brackets):
    stack = []
    for bracket in brackets:
        if bracket in '([{<':
            stack.append(bracket)
        else:
            if bracket == ')' and stack[-1] == '(':
                stack.pop()
            elif bracket == ']' and stack[-1] == '[':
                stack.pop()
            elif bracket == '}' and stack[-1] == '{':
                stack.pop()
            elif bracket == '>' and stack[-1] == '<':
                stack.pop()
            else:
                return False  # This is a corrupted brackets input.
    if len(stack) == 0:
        return ''

    neededClosingBrackets = ''
    while len(stack) > 0:
        openingBracket = stack.pop()
        if openingBracket == '(':
            neededClosingBrackets += ')'
        if openingBracket == '{':
            neededClosingBrackets += '}'
        if openingBracket == '[':
            neededClosingBrackets += ']'
        if openingBracket == '<':
            neededClosingBrackets += '>'

    return neededClosingBrackets


allTotals = []
pointValues = {')': 1, ']': 2, '}': 3, '>': 4}

for brackets in data:
    total = 0
    neededClosingBrackets = getNeededClosingBrackets(brackets)

    if not neededClosingBrackets:
        continue # These brackets were corrupted.

    for bracket in neededClosingBrackets:
        total *= 5
        total += pointValues[bracket]
    allTotals.append(total)

allTotals.sort()
print(allTotals[len(allTotals) // 2])
